@Component({
  selector: 'app-places-container',
  standalone: true,
  imports: [],
  templateUrl: './places-container.component.html',
  styleUrls: ['./places-container.component.css']
})
export class PlacesContainerComponent {
  @Input({required:true}) title!:String;
}
<section>
  <h2>{{ title}}</h2>
  <ng-content />
</section>
